If a dictionary contains a field whose type is an interface , then that field will hold a reference to an underlying instance of a Rust struct. The Rust code for working with such fields must store them as an Arc in order to help properly manage the lifetime of the instance. So if the UDL interface looked like this: interface User { // Some sort of "user" object that can own todo items
